textOriginal:
Acho que esperamos demais de Alexandre de Morais, mas ele tem feito menos do que deveria;
ele já poderia até ter levado a plenário pedido de cassação da candidatura do Jair. Mesmo como ministro do STF, não creio em que vá prender Carlos Bolsonaro, mesmo que haja 
indícios para tanto

Não adianta o que fazem contra eles ou o que eles fazem ou deixam de fazer, eles jogam sujo.
1) Coação de pastores evangélicos especialmente no "culto"de sábado à noite;
2) Coação das milícias em pontos específicos;
3) Coação dos empregados pelos patrões;
4) Compra de votos pura e simples, R$100,00 agora e depois mais R$100,00 se o capeta for eleito;
5) A inexorável máquina de fake news;
6) etc
Então acontece que para ganhar mesmo as pesquisas deveriam apontar Lula com pelo menos 15% a mais, e glórias ao NE berço de Augusto dos Anjos, Castro Alves e do mestre Lula, mas a propósito, ele não está deixando sucessor!!!
Em suma eles são podres. Mas então, o que fazer Thiago!?
